import React from 'react';
import { Typography } from '@material-ui/core';
import { Button } from '@material-ui/core';
import {Grid} from '@material-ui/core';

const Experience = () => {
    return (
        <Grid container
        direction="row"
        justify="flex-start"
        alignItems="center">
            <Grid item xs={12}>
                <Typography
                variant='h1'
                color='white'>
                    Work Experience
                </Typography>
            </Grid>
        </Grid>
    )
}

export default Experience;
